import Course from "../course/Course"
import data from "../../data.json"
import style from'./CourseList.module.scss';

const CourseList = () => {
    console.log(data);
    return (
        <div className={style.div}>
            {data.map ((item, index) => {
                return <Course key={index} course={item}/>
            })}
        </div>
    )
}

export default CourseList;
